// import logo from './logo.svg';
import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { Login } from "./pages/Login";

import Navbar from "./components/Navbar";
import Footer from "./components/Footer";
// import Login from "./pages/Login";
import ColonoscopyResources from "./pages/ColonoscopyResources";
import ColonCancerInfo from "./pages/ColonCancerInfo";
import ContactUs from "./pages/ContactUs";
import Faq from "./pages/Faq";
import ColonoscopyAppointment from "./pages/ColonoscopyAppointment";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route
            path="/"
            element={
              <>
                <Navbar />
                <Login />
              </>
            }
          />
          <Route path="/login" element={<Login />} />
          <Route
            path="/coloncancerinfo"
            element={
              <>
                <Navbar />
                <ColonCancerInfo />
              </>
            }
          />
          <Route
            path="/colonoscopyResources"
            element={<ColonoscopyResources />}
          />
          <Route path="/contactUs" element={<ContactUs />} />
          <Route path="/faq" element={<Faq />} />
          <Route
            path="/colonoscopyAppointment"
            element={<ColonoscopyAppointment />}
          />
        </Routes>
        <Footer />
      </Router>
    </div>
  );
}

export default App;
